import React, { Component } from 'react';
import NavBar from "../components/NavBar";
import Footer from "../components/Footer";
import axios from "../axios";


export default class AdminScreen extends Component {

    componentDidMount(){
        axios
            .post("/api/merchandise")
    }

    render() {
        return (
            <div>
                <NavBar
                    username={this.props.username}
                    onLogin={this.props.onLogin}
                />
                <div className = "container"> 
                    <div className="form-group">
                        <input onChange={this.handleInputChange} className="form-control" name="id" type="text" placeholder="id" required/>
                    </div>
                    <div className="form-group">
                        <input onChange={this.handleInputChange} className="form-control" name="name" type="text" placeholder="name" required/>
                    </div>
                    <div className="form-group">
                        <input onChange={this.handleInputChange} className="form-control" name="image" type="text" placeholder="image" required/>
                    </div>
                    <div className="form-group">
                        <input onChange={this.handleInputChange} className="form-control" name="size" type="text" placeholder="size" required/>
                    </div>
                    <div className="form-group">
                        <input onChange={this.handleInputChange} className="form-control" name="description" type="text" placeholder="descpription" required/>
                    </div>
                    <div className="form-group">
                        <input onChange={this.handleInputChange} className="form-control" name="price" type="text" placeholder="price" required/>
                    </div>
                    <div className="form-group">
                        <input onChange={this.handleInputChange} className="form-control" name="types" type="text" placeholder="types" required/>
                    </div>

                </div>
                <Footer/>
            </div>
        )
    }
}
